   using namespace std; 
       class Stack
        {
            int top;
            public:
            int a[10];  
            Stack()
            {
                top = -1;
            }
            void push(int x);
            int pop();
            bool isEmpty();
        };
        // function to insert data into stack
        void Stack::push(int x)
        {
            if(top >= 10)
            {
                cout << "Stack Overflow \n";
            }
            else
            {
                a[++top] = x;
                cout << "Element Inserted into Stack\n";
            }
        }
        // function to remove data from the top of the stack
        int Stack::pop()
        {
            if(top < 0)
            {
                cout << "Stack Underflow \n";
                return 0;
            }
            else
            {
                int d = a[top--];
                return d;
            }
        }
        // function to check if stack is empty
        bool Stack::isEmpty()
        {
            if(top < 0)
            {
                return true;
            }
            else
            {
                return false;
            }
        }
        class Queue {
            public:
            Stack S1, S2;
            void enqueue(int x);
            int dequeue();
        };
        // enqueue function
        void Queue :: enqueue(int x) 
        {
            S1.push(x);
            cout << "Element Inserted into Queue\n";
